import react from "react";
import Card from "../../UI/Card";


const DayCard = (props) => {

    //probaj se igrati s ovim ikonicama malo, ali onda idi dalje sa user storyiima!!!

    console.log("in DayCard.js");
    console.log(props.dailyForecast);

    const imgURL = `owf owf-${props.dailyForecast.icon} owf-5x`

    return (
        <div className="col-sm-2">
            <div className="card">
                <h2 className="card-title">{props.dailyForecast.dayName}</h2>
                <i className={imgURL}>{props.dailyForecast.icon}</i>
                <h3>{Math.round(props.dailyForecast.minTemp)} °C</h3>
                <h3>{Math.round(props.dailyForecast.maxTemp)} °C</h3>
            </div>
        </div>
    );
}



export default DayCard;
